import React from "react";

export default function Education(props) {
  return (
    <div className="education" id="education">
      {props.education.map((data, i) => {
        return (
          <div key={i} className="educationcards">
            <div>{data.institution}</div>
            <div className="flex-edu-details">
              <div className="col-6">
                <div>{data.studyType}</div>
                <div>{data.area}</div>
              </div>
              <div className="col-6">
                <div title="Duration" className="edu-span">
                  <span className="edu-startdate">
                    {data.end.year}/{data.end.month}
                  </span>
                </div>
                <div className="grade">{data.score}</div>
              </div>
            </div>
          </div>
        );
      })}
    </div>
  );
}
